code_examples.example:
# Command :- ::ixiangpf::interface_config
# This example will configure an Ethernet Interface
set ethernet [::ixiangpf::interface_config \ -protocol_name {Ethernet 1} \ -protocol_handle <device_group_handle> \ -mtu 1500 \ -src_mac_addr 00:00:00:00:01:11 \ -vlan 1 \ -vlan_id 1 \ -vlan_id_step 0 \ -vlan_id_count 1 \ -vlan_tpid 0x8100 \ -vlan_user_priority 0 \ -vlan_user_priority_step 0 \ ]
# The command above will generate output as shown below: # {status 1} {ethernet_handle ethernetHandles} # {interface_handle {interfaceHandles}}
# This example will configure an IPv4 Interface
set ipv4 [::ixiangpf::interface_config \ -protocol_name {IPv4 1} \ -protocol_handle <ethernet_handle> \ -ipv4_multiplier 1 \ -ipv4_resolve_gateway 1 \ -ipv4_manual_gateway_mac 00.00.00.00.00.01 \ -ipv4_manual_gateway_mac_step 00.00.00.00.00.00 \ -ipv4_enable_gratarprarp 0 \ -ipv4_gratarprarp gratarp \ -gateway 100.1.1.1 \ -intf_ip_addr 101.1.1.1 \ -netmask 255.255.255.0 \ ]
# The command above will generate output as shown below: # {status 1} {ipv4_handle ipv4handle} # {interface_handle {interfaceHandles}}
# This example will modify an existing Ipv4 Interface
set ipv4_modified [::ixiangpf::interface_config \ -mode modify \ -protocol_handle <ipv4_interface_handle> \ -intf_ip_addr 112.12.12.12 \ ]
# The command above will generate output as shown below: # {status 1}
# This example will configure an IPv6 Interface
set ipv6 [::ixiangpf::interface_config \ -protocol_name {IPv6 1} \ -protocol_handle <ethernet_handle> \ -ipv6_multiplier 1 \ -ipv6_resolve_gateway 1 \ -ipv6_manual_gateway_mac 00.00.00.00.00.01 \ -ipv6_manual_gateway_mac_step 00.00.00.00.00.00 \ -ipv6_gateway 2001:0:0::1 \ -ipv6_intf_addr 2000:0:0::1 \ -ipv6_prefix_length 64 \ ]
# The command above will generate output as shown below: # {status 1} {ipv6_handle ipv6Handle} # {interface_handle {interfaceHandles}}

# Command :- ixiangpf::interface_config
# This example will configure an Ethernet Interface
my $ethernet = ixiangpf::interface_config ({
    protocol_name                                               => "{Ethernet 1}",
    protocol_handle                                             => "<device_group_handle>",
    mtu                                                         => "1500",
    src_mac_addr                                                => "00:00:00:00:01:11",
    vlan                                                        => "1",
    vlan_id                                                     => "1",
    vlan_id_step                                                => "0",
    vlan_id_count                                               => "1",
    vlan_tpid                                                   => "0x8100",
    vlan_user_priority                                          => "0",
    vlan_user_priority_step                                     => "0",
});
# The command above will generate output as shown below:
# {status 1} {ethernet_handle ethernetHandles}
# {interface_handle {interfaceHandles}}
# This example will configure an IPv4 Interface
my $ipv4 = ixiangpf::interface_config ({
    protocol_name                                               => "{IPv4 1}",
    protocol_handle                                             => "<ethernet_handle>",
    ipv4_multiplier                                             => "1",
    ipv4_resolve_gateway                                        => "1",
    ipv4_manual_gateway_mac                                     => "00.00.00.00.00.01",
    ipv4_manual_gateway_mac_step                                => "00.00.00.00.00.00",
    ipv4_enable_gratarprarp                                     => "0",
    ipv4_gratarprarp                                            => "gratarp",
    gateway                                                     => "100.1.1.1",
    intf_ip_addr                                                => "101.1.1.1",
    netmask                                                     => "255.255.255.0",
});
# The command above will generate output as shown below:
# {status 1} {ipv4_handle ipv4handle}
# {interface_handle {interfaceHandles}}
# This example will modify an existing Ipv4 Interface
my $ipv4_modified = ixiangpf::interface_config ({
    mode                                                        => "modify",
    protocol_handle                                             => "<ipv4_interface_handle>",
    intf_ip_addr                                                => "112.12.12.12",
});
# The command above will generate output as shown below:
# {status 1}
# This example will configure an IPv6 Interface
my $ipv6 = ixiangpf::interface_config ({
    protocol_name                                               => "{IPv6 1}",
    protocol_handle                                             => "<ethernet_handle>",
    ipv6_multiplier                                             => "1",
    ipv6_resolve_gateway                                        => "1",
    ipv6_manual_gateway_mac                                     => "00.00.00.00.00.01",
    ipv6_manual_gateway_mac_step                                => "00.00.00.00.00.00",
    ipv6_gateway                                                => "2001:0:0::1",
    ipv6_intf_addr                                              => "2000:0:0::1",
    ipv6_prefix_length                                          => "64",
});
# The command above will generate output as shown below:
# {status 1} {ipv6_handle ipv6Handle} 
# {interface_handle {interfaceHandles}}
